(1, 0, 'Người gốc Hoa bỗng thành hình mẫu chống nCoV ở Italy', 'https://vnexpress.net/the-gioi/nguoi-goc-hoa-bong-thanh-hinh-mau-chong-ncov-o-italy-4077887.html', 'poduct-1-9359.jpeg', 'Hai tháng trước, cộng đồng người Hoa ở Prato, vùng Tuscan, miền trung Italy trở thành mục tiêu của những hành động &quot;phân biệt đối xử đáng xấu hổ&quot;, theo Tổ chức Ân xá Quốc tế. 50.000 người gốc Hoa tại đây bị nhục mạ, thậm chí bị tấn công, khi nhiều người Italy lo sợ rằng họ sẽ làm lây lan Covid-19 ở nước này.', 0, '1592626012', 0, 0, 0, 0, 0, 0, 0, 1),
