INSERT INTO `table_static` (`id`, `photo`, `options`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `tenen`, `tenvi`, `taptin`, `type`, `hienthi`, `ngaytao`, `ngaysua`) VALUES
(1, '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', 'gioi-thieu', '', '&lt;p&gt;Plimsolls were popularly used by far riders and later also began to be used by tennis and croquet athletes for their comfort. Special soles and motifs were engraved below to increase the surface friction of the developed shoes, and gradually they were widely used for the British army. The shoe was also gradually used more for daily commuting and in outdoor activities in the 20th century, plimsolls were even discovered along with the body of the ill-fated Terra Nova expedition. Plimsolls is even a mandatory shoe in the British gym class. [Citation needed]&lt;/p&gt;\r\n', '&lt;p&gt;Ban đầu những đôi giày này được gọi với cái tên \'plimsoll\' vào thập niên 1870, xuất hiện trong cuốn sách The Plimsoll Sensation của Nicholette Jones.&lt;a href=&quot;\\&quot;&gt;[7]&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Plimsolls được sử dụng phổ biến bởi những người đi chơi xa và sau đó cũng bắt đầu được sử dụng bởi các vận động viên môn &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;tennis&lt;/a&gt; và &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;croquet&lt;/a&gt; vì sự thoải mái của chúng. Phần đế đặc biệt cùng hoạt tiết được khắc chìm bên dưới để gia tăng ma sát bề mặt của những đôi giày đựoc phát triển, và dần dần chúng cũng được dùng rộng rãi cho &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;quân đội Anh&lt;/a&gt;. Loại giày cũng dần dần được sử dụng nhiều hơn cho những công việc đi lại hàng ngày và trong các hoạt động ngoài trời vào thế kỷ 20, plimsolls thậm chí được phát hiện cùng với xác của đoàn leo núi &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;thám hiểm Terra Nova&lt;/a&gt; xấu số. Plimsolls thậm chí cũng là một loại giày bắt buộc trong các tiết học &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;thể dục&lt;/a&gt; của nước Anh.[&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;cần dẫn nguồn&lt;/a&gt;]&lt;/p&gt;\r\n\r\n&lt;p&gt;Công ty giày &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;J.W. Foster and Sons&lt;/a&gt; của anh bắt đầu sản xuất mẫu giày chạy bộ đầu tiên vào năm 1895; đôi giày có lớp gai ở đế để giúp thuận lợi hơn cho việc gia tăng sức bền và tốc độ. Công ty sau đó bán ra những mẫu giày handmade chất lượng cao tới các vận động viên điền kinh trên khắp thế giới, và cuối cùng nhận được một hợp đồng sản xuất giày của đội tuyển Anh tham dự &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;thế vận hội mùa hè Olympic 1924&lt;/a&gt;. &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Harold Abrahams&lt;/a&gt; và &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Eric Liddell&lt;/a&gt; đã chiến thắng trong phần thi chạy 100m và 400m, sử dụng những đôi giày của nhà Foster.&lt;a href=&quot;\\&quot;&gt;[8]&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Một đôi giày điền kinh màu trắng với hoạ tiết hồng của &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Nike&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Còn tại Mỹ, thiết kế của giày dép dần trở nên đáng chú ý hơn ở cuối của thế kỷ 20, lúc này chúng được gọi là &quot;sneakers&quot;. Vào năm 1892, Công ty U.S. Rubber giới thiệu mẫu giày đế cao su đầu tiên trong nước, trở nên nổi như cồn và liên tục cháy hàng. Đôi giày bóng rổ đầu tiên được thiết kế bởi &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Spalding&lt;/a&gt; vào đầu năm 1907. Thị trường giày sneaker tiếp tục phát triển sau &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Thế chiến thứ nhất&lt;/a&gt;, khi thể thao và điền kinh dần trở thành một cách để tôn vinh tinh thần và lòng yêu nước. Thị trường sneaker tại Mỹ gia tăng nhanh chóng khi các cậu thiếu niên bắt đầu mua sneaker vì thần tượng của chúng, cầu thủ bóng đá &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Jim Thorpe&lt;/a&gt;, bên cạnh đó là mẫu giày &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Converse All Stars&lt;/a&gt; được quảng cáo bởi vân động viên bóng rổ &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Chuck Taylor&lt;/a&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;giai đoạn giữa hai cuộc chiến tranh&lt;/a&gt;, giày thể thao cũng dần được quảng bá ở các môn thể thao khác, các thiết kế khác nhau được sử dụng cho cả nam và nữ. Giày điền kinh lúc này được vận động viên sử dụng để tranh đấu tại &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Olympics&lt;/a&gt;, giúp phổ biến hình ảnh giày điền kinh tới toàn thể công chúng. Vào năm 1936, một nhãn hiệu của Pháp, Spring Court,&lt;a href=&quot;\\&quot;&gt;[9]&lt;/a&gt; đã quảng bá đôi giày tennis đầu tiên làm từ chất liệu vải canvas với đế cao su tự nhiên.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Adolf &quot;Adi&quot; Dassler&lt;/a&gt; bắt đầu sản xuất đôi giày thể thao đầu tiên của riêng mình trong phòng bếp của mẹ ông ở &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Herzogenaurach&lt;/a&gt;, &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Bavaria&lt;/a&gt; sau khi trở về từ Thế chiến thứ nhất, rồi sau đó ông đã tiến hành khai trương một cơ sở sản xuất giày mà về sau trở thành một thương hiệu thể thao toàn cầu, &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;Adidas&lt;/a&gt;.&lt;a href=&quot;\\&quot;&gt;[10]&lt;/a&gt; Ông rất thành công trong việc quảng bá đôi giày của mình tới các vận động viên điền kinh trong &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;thế vận hội mùa hè 1936&lt;/a&gt;, điều này giúp sản phẩm của công ty ông trở nên phổ biến hơn với công chúng. Dần dần, việc kinh doanh trở nên phát đạt và Dasslers đã bán được 200.000 đôi giày mỗi năm trước &lt;a href=&quot;\\&quot; title=&quot;\\&quot;&gt;chiến tranh thế giới thứ hai&lt;/a&gt;.&lt;a href=&quot;\\&quot;&gt;[11]&lt;/a&gt;&lt;/p&gt;\r\n', '&lt;p&gt;About us desc&lt;/p&gt;\r\n', '', 'About us', 'Giới thiệu', '18318_taptin.rar', 'gioi-thieu', 1, 1597117692, 1603356426),
